export function getTodayDateString() {
  return new Date().toLocaleDateString()
}

export function isTodayString(str) {
  return new Date().toLocaleDateString() === str;
}

export function removeStringFrom(target, toRemove){
  return target.replace(toRemove, '')
}

export function removeStringAllSpaces(target){
  return target.replace(/ /g, "")
}

export function removeFirstLineBreak(str) {
  return str.split('n').filter(s => s.trim().length > 0).join('n');
}

export function processLitigationOptions(litigationRegulationChapters= [], litigationRegulationSections = []) {
  const result = [];
  const map = new Map();
  litigationRegulationSections.forEach(item => {
    const {chapter, section} = item;
    if (map.has(chapter)) {
      const sections = map.get(chapter);
      sections.push(section);
    } else {
      map.set(chapter, [section]);
    }
  });

  litigationRegulationChapters.forEach(item => {
    const obj = {
      chapter: item,
      sub: map.get(item)
    }
    result.push(obj);
  })

  return result;
}

export function isStartWith(line, highlightWords) {
  for (let i = 0; i < highlightWords.length; i++) {
    if (line.indexOf(highlightWords[i]) === 0 && line.trim().length === highlightWords[i].length) {
      return highlightWords[i];
    }
  }
  return false;
}

export function getText(text) {
  if (Array.isArray(text)) {
    return text.join('\n')
  }
  return text
}

