export const findAndHighlight = (str, index, key) => {
  const regExp =new RegExp(key,"g");
  if (key) {
    return '<div>' + key ? str.replace(regExp, `<span class='highlight-keyword'>${key}</span>`) : str + '</div>'
  } else {
    return '<div>' + str + '</div>'
  }
}

export const getExampleSearchTag = (example) => {
  const {type, number, date} = example
  if (type === 'guide-examples-procuratorate') {
    return `最高检指导案例第${number}号`
  } else if (type === 'guide-examples-court') {
    return `最高法指导案例第${number}号`
  } else if (type === 'open-examples-court') {
    return `最高法公报案例 ${date}`
  } else if (type === 'typical-examples-court') {
    return `最高法典型案例 ${date}`
  }
  return ''
}

export const copy = (text) => {
  Taro.showLoading({
    title: '复制中',
  })
  Taro.cloud.callFunction({
    name: 'checkBeforeCopy',
    complete: r => {
      console.log(r)
      const {result} = r
      if (result.isValid) {
        Taro.setClipboardData({
          data: text,
          success: function () {
            Taro.hideLoading()
            Taro.showToast({
              title: '文字已复制到剪贴板',
              icon: 'none',
              duration: 2000
            })
          }
        });
      } else {
        Taro.showToast({
          title: '复制失败: 无积分或其他原因',
          icon: 'none',
          duration: 4000
        })
        Taro.hideLoading()
      }

    }
  })

}

