export const refine = (s) => {
  const str = s.trim()
  if(str && str.length > 0) {
    if(str.charAt(0) === '【' && str.charAt(str.length-1) === '】' ){
      return str.replace('【', '').replace('】', '');
    }
    if(str.charAt(0) === '[' && str.charAt(str.length-1) === ']' ){
      return str.replace('[', '').replace(']', '');
    }
  }
  return str;
}
